import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Rating = ({ role }) => {
  const [form, setForm] = useState({
    lecture_id: '',
    target_id: '',
    rating: '',
    comment: ''
  });
  const [message, setMessage] = useState('');
  const [ratings, setRatings] = useState([]);

  const handleChange = (e) => setForm({ ...form, [e.target.name]: e.target.value });

  const fetchRatings = async () => {
    try {
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/rating`, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setRatings(res.data.ratings || []);
    } catch (err) {
      console.error('Fetch ratings error:', err);
    }
  };

  useEffect(() => {
    fetchRatings();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        `${process.env.REACT_APP_API_URL}/rating`,
        form,
        { headers: { 'x-auth-token': localStorage.getItem('token') } }
      );
      setMessage(res.data.message);
      setRatings(res.data.ratings || []);
      setForm({ lecture_id: '', target_id: '', rating: '', comment: '' });
    } catch (err) {
      setMessage(err.response?.data?.message || 'Error submitting rating');
      console.error('Rating submit error:', err);
    }
  };

  return (
    <div style={{ marginTop: '20px' }}>
      <div style={{
        border: '1px solid #ccc',
        padding: '20px',
        borderRadius: '10px',
        boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
        maxWidth: '400px',
        marginBottom: '20px'
      }}>
        <h3>{role === 'student' ? 'Rate Lecturer' : 'Rate Student'}</h3>
        {message && <p style={{ color: 'green' }}>{message}</p>}

        <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
          <input
            type="text"
            name="lecture_id"
            placeholder="Lecture ID"
            value={form.lecture_id}
            onChange={handleChange}
            required
            style={{ padding: '8px', borderRadius: '5px', border: '1px solid #ccc' }}
          />
          <input
            type="text"
            name="target_id"
            placeholder={role === 'student' ? 'Lecturer ID' : 'Student ID'}
            value={form.target_id}
            onChange={handleChange}
            required
            style={{ padding: '8px', borderRadius: '5px', border: '1px solid #ccc' }}
          />
          <input
            type="number"
            name="rating"
            placeholder="Rating (1-5)"
            min="1"
            max="5"
            value={form.rating}
            onChange={handleChange}
            required
            style={{ padding: '8px', borderRadius: '5px', border: '1px solid #ccc' }}
          />
          <textarea
            name="comment"
            placeholder="Comment (optional)"
            value={form.comment}
            onChange={handleChange}
            style={{ padding: '8px', borderRadius: '5px', border: '1px solid #ccc', minHeight: '60px' }}
          />
          <button type="submit" style={{
            padding: '10px',
            borderRadius: '5px',
            border: 'none',
            backgroundColor: '#007bff',
            color: '#fff',
            cursor: 'pointer'
          }}>Submit Rating</button>
        </form>
      </div>

      <h3>All Ratings</h3>
      <div style={{ display: 'flex', flexWrap: 'wrap', gap: '15px' }}>
        {ratings.length > 0 ? ratings.map((r) => (
          <div key={r.id} style={{
            border: '1px solid #ccc',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 2px 5px rgba(0,0,0,0.1)',
            width: '250px'
          }}>
            <p><strong>Lecture ID:</strong> {r.lecture_id}</p>
            <p><strong>Student ID:</strong> {r.student_id}</p>
            <p><strong>Lecturer ID:</strong> {r.lecturer_id}</p>
            <p><strong>Rating:</strong> {r.rating}</p>
            <p><strong>Comment:</strong> {r.comment || '-'}</p>
          </div>
        )) : <p>No ratings yet.</p>}
      </div>
    </div>
  );
};

export default Rating;
